input:-ms-input-placeholder {
    opacity: 1;
    color: #a6a3c1; }

input::-moz-placeholder {
    opacity: 1;
    color: #a6a3c1; }

input.placeholder {
    opacity: 1;
    color: #a6a3c1; }

