a {
    text-decoration: underline;
    color: #4c9cb9;

}

a:hover {
    text-decoration: none;
}

.step1 {
    padding-top: 134px;
    max-width: 380px;
    width: 95%;
    margin: 0 auto;
    text-align: center;
}

.step1__title {
    color: #000;
    font-size: 36px;
    padding-top: 96px;
    background: url("../img/cart.png") center top no-repeat;
    margin-bottom: 14px;
}
.step1__subtitle {
    color: #000;
    font-size: 30px;
    margin-bottom: 60px;
}
.step1__text {
    color: #000;
    margin-bottom: 58px;
    line-height: 1.6;
}
.step1__text_strong {
    font-weight: 500;
}
.step1__text_light {
    font-size: 14px;
    color: #8c89a9;
    font-style: italic;
}

.footer {
    height: 160px;
    margin: 110px 30px 0 30px;
    border-top: 1px solid #dfdfdf;
    padding-top: 20px;
    padding-left: 68px;
    font-size: 14px;
    line-height: 1.7;
    letter-spacing: -0.5px;
    color: #888;
}
.footer p {
    font-style: italic;
}
.footer dl {
    overflow: hidden;
    margin-bottom: 20px;
}
.footer dt {
    float: left;
    margin-right: 4px;
    clear:left;
}
.footer dd{
    min-height:15px;
    font-weight: 500;
    color: #555;
}
.blink {
    width: 886px;
    height: 362px;
    background: url('data:image/png;base64,') no-repeat;
    position: fixed;
    top: 0;
    left: -200px;
    opacity: 0.1;

    -webkit-animation-name: animBlink;
    animation-name: animBlink;
    -webkit-animation-duration: 2s;
    animation-duration: 2s;
    -webkit-animation-iteration-count: infinite;
    animation-iteration-count: infinite;
}
@keyframes animBlink {
    0% {
        opacity: 0.1; }
    50% {
        opacity: 1; }
    100% {
        opacity: 0.1; }
}

.step3 {
    padding-top: 87px;
    max-width: 380px;
    width: 95%;
    margin: 0 auto;
    text-align: center;
}

.step3__title {
    color: #000;
    font-size: 36px;
    padding-top: 213px;
    background: url("../img/salut.png") center top no-repeat;
    margin-bottom: 31px;
}
.step3__text {
    color: #000;
    margin-bottom: 108px;
    line-height: 1.6;
}
.step3__text p {
    margin-bottom: 28px;
}
.button {
    width: 242px;
    height: 60px;
    color: #fff;
    font-size: 14px;
    text-transform: uppercase;
    text-decoration: none;
    line-height: 60px;
    background-color: #7ab300;
    border-radius: 4px;
    box-shadow: 0.1px 4px 6.3px 0.7px rgba(0, 0, 0, 0.16);
    display: inline-block;
    cursor: pointer;
}
a.button {
    line-height: 64px;
}

.button:hover {
    background-color: #9ccd05;
    box-shadow: 0.1px 4px 6.3px 0.7px rgba(0, 0, 0, 0.16);
}
.button:active {
    color: #9bcc34;
    background-color: #6a9a04;
    box-shadow: none;
}
.button[disabled] {
    color: #dedbdb;
    background-color: #a2a2a2;
    box-shadow: 0.1px 4px 6.3px 0.7px rgba(0, 0, 0, 0.16);
    cursor: auto;
}

.step1__text_red {
    color: #ff0d0d;
    font-weight: 500;
}

.step2 {
    max-width: 360px;
    width: 95%;
    padding-top: 32px;
}

.step2 .step1__title {
    background-image: url('data:image/png;base64,');
}

.step2 .step1__text {
    margin-bottom: 40px;
}

.form-line {
    margin-bottom: 14px;
    position: relative;
}

.input {
    width: 300px;
    height: 60px;
    background-color: #e5ebef;
    border-radius: 4px;
    font-size: 14px;
    color: #758895;
    text-align: center;
    border: 2px solid #e5ebef;
    padding: 0 7px;

}
label{
    font-size: 13px;
    color: #758895;
    position: absolute;
    left: 45px;
    top: 9px;
    display: none;
}
.input:focus + label,
.input.valid + label,
.input.invalid + label {
    display: block;
}


.input:focus {
    border-color: #52add7;
    background-color: transparent;
    color: #000;
}

.input.valid {
    background-position: calc(100% - 16px) center;
    background-repeat: no-repeat;
    background-image: url('data:image/png;base64,');
}
.input.invalid {
    background-position: calc(100% - 16px) center;
    background-repeat: no-repeat;
    background-image: url('data:image/png;base64,');
}



input[type="submit"] {
    margin-top: 19px;
}


@media only screen and (max-width: 500px) {
    .footer {
        padding-left: 0;
    }
}
